public class Dowhile_odd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=1;
		do
		{
			if(i%2!=0)
			{
				System.out.println(i+" is an ODD Number");
				
			}
			i++;
				}while(i<=20);
		
	}

}
